def xor_string(a, b):
  result = ""
  for i in range(0, min(len(a), len(b)), 2):
    a_num = int(a[i] + a[i + 1], 16)
    b_num = int(b[i] + b[i + 1], 16)
    s = hex(a_num ^ b_num)[2:]
    if len(s) == 1:
      s = "0" + s
    result += s
  return result

def solve(encode_key, encode_flag):
  zero = "30" * 100
  decode_key = xor_string(zero, encode_key)
  decode_flag = xor_string(encode_flag, decode_key)
  print(decode_flag)

